1. Use `Object.keys()` to get an array of keys from the dictionary.
2. Sort the array of keys using `sort()`.
3. Loop over the sorted array and log the value for each key.

Here's an example:
```css
const myDict = {
  "apple": "fruit",
  "banana": "yellow fruit",
  "orange": "citrus fruit"
};

Object.keys(myDict).sort().forEach(key => {
  console.log(key, myDict[key]);
});
```
This will output:
```
apple fruit
banana yellow fruit
orange citrus fruit
```
